import React, { Component } from "react";

class NavBar extends Component {
  render() {
    const styleTitle = { color: "#0DD2A3" };
    const layer = { color: "#B9F1E4", z: 1, position: "relative" };
    const styleButton = { color: "#0DD2A3", z: 3 };
    const styleBackButton = { background: "#DEDEDE" };
    const styleSearch = {
      width: "500px",
      height: "58px",
      fontFamily: "FontAwesome"
    };
    return (
      <nav className="navbar navbar-light bg-light justify-content-between">
        <a className="navbar-brand font-weight-bold" style={styleTitle}>
          SmartOffice
        </a>

        <form className="form-inline">
          <button
            className="btn  my-2 my-sm-0 m-1 shadow-sm p-3 mb-5 rounded text-white"
            type="submit"
            style={styleBackButton}
          >
            <i className="fas fa-arrow-left fa-lg" />
          </button>
          <button
            className="btn  my-2 my-sm-0 m-4 shadow-sm p-3 mb-5 rounded bg-light"
            type="submit"
            style={styleButton}
          >
            <i className="far fa-bell fa-lg" />
            <i className="fas fa-bell fa-lg" style={layer} />
          </button>
          <input
            className="form-control mr-sm-2"
            type="search"
            placeholder="Search for a specific item &#xF002;"
            aria-label="Search"
            style={styleSearch}
          />
        </form>
      </nav>
    );
  }
}

export default NavBar;
